    "# 1. Rastgele 1000 sayı üret (normal dağılımlı)\n",
    "veri <- rnorm(1000, mean = 50, sd = 10)\n",
    "\n",
    "# 2. Temel istatistikleri yazdır\n",
    "summary(veri)\n",
    "\n",
    "# 3. Histogram çiz\n",
